async function o({target:t,dataUrl:c,view:i="monthly"}){let e=document.querySelector(t);if(!e)return;let n=await(await fetch(c)).json(),s=Object.values(n.events||{});e.innerHTML=`
    <div class="popcal-calendar">
      ${s.map(a=>`
        <div class="popcal-event">
          <div class="popcal-title">${a.title}</div>
          <div class="popcal-date">${a.start}</div>
          <div class="popcal-location">${a.location?.name||""}</div>
        </div>
      `).join("")}
    </div>
  `}var d={render:o};export{d as default};
